import React, { Component } from 'react';
import { Container, Row, Col, Card, CardColumns} from 'react-bootstrap';
import { BrowserRouter as Router, Route, Switch, Link, useLocation} from "react-router-dom";

function CoverBlog(props) {
  return (
    <Card >
      <Card.Img variant="top" width={226} height={200}
        src={props.imageUrl} />
      <Card.Body>
        <Card.Title>{props.title}</Card.Title>
        <Card.Text>{props.description}</Card.Text>
      </Card.Body>
      <Card.Footer>
        <small className="text-muted">Last updated 3 mins ago</small>
      </Card.Footer>     
    </Card>
  );
}


class Blog extends Component{
  constructor(props) {
    super(props);
  }

  render() {
    const blog1 = {
      imageUrl : "../asserts/images/smarthome.jpg",
      title : "Creating a personal website from scratch",
      description : "Developed using the library TensorFlow for React-Native, this app can identify objects by taking photos with deploying a custom-trained image classification model."
    };


    return (

      <div >
          <Container className="display">
              <Row>
                <Col >              
                </Col>
                <Col xs={12} md={4} >
                <h2 className='header'>Blog</h2>
                </Col>
                <Col >              
                </Col>
              </Row>
          </Container>

          <Container className="display">
          <CardColumns>
                <CoverBlog imageUrl={this.props.imageUrl} title={this.props.title} description={this.props.description} />


                  <Card>

                    <Card.Img variant="top"  width={226} height={200}
                              src={require("../asserts/images/personalWeb.jpg")}/>
                    <Card.Body>
                      <Card.Title>Creating a personal website from scratch</Card.Title>
                      <Card.Text>
                        Using React we can quicly create a simple personal website, with basic Javascript/html/CSS,
                        no expertise needed
                      </Card.Text>
                    </Card.Body>
                    <Card.Footer>
                      <small className="text-muted">Last updated 3 mins ago</small>
                    </Card.Footer>
                  </Card>
                  <Card>
                    <Card.Img variant="top" src="holder.js/100px160" />
                    <Card.Body>
                      <Card.Title>Card title</Card.Title>
                      <Card.Text>
                        This is a wider card with supporting text below as a natural lead-in to
                        additional content. This card has even longer content than the first to
                        show that equal height action.
                      </Card.Text>
                    </Card.Body>
                    <Card.Footer>
                      <small className="text-muted">Last updated 3 mins ago</small>
                    </Card.Footer>
                  </Card>
                </CardColumns>
          </Container>


      </div>

    );
  }
}

export default Blog;
